<div class="start-num">定时休息眼睛哦@@@ (PC Web Only)</div>
<div id="id026">
  <div class="form">
    (&nbsp;<input class="work" type="text" placeholder="Work (mins)" > + 
    <input class="break" type="text" placeholder="Break (mins)" >&nbsp;) x 
    <input class="cycles" type="text" placeholder="Cycles" >
    = <span>Time left </span>
  </div>
  <div class="btn">  
    <button class="start">Start</button>
    <button class="pause">Pause</button>
    <button class="clear">Clear</button>
    <span class="cycleShow"> Current Cycle No.: </span>
  </div>
  <div class="countdown">

    <span class="hour">00</span>
    <i>:</i>
    <span class="minute">00</span>
    <i>:</i>
    <span class="second">00</span>
    
  </div>
  <div class="mobile">
  <audio id="myAudio" controls>
    <source src="audio/vibraphone.mp3" type="audio/mpeg">
  </audio>
  </div>
</div>
